    return ( <MDBCol >
        <MDBCard className = "homecard" style = {{ width: "15rem", height: "20rem" }
        } >
        <
        MDBCardImage className = "img-fluid"
        src = "https://mdbootstrap.com/img/Photos/Others/images/43.jpg"
        waves / >
        <
        MDBCardBody >
        <
        MDBCardTitle > Pizza < /MDBCardTitle> <
        MDBCardText >
        Receipt Breakdown <
        /MDBCardText> <
        MDBBtn href = "#" > Pay Now < /MDBBtn> < /
        MDBCardBody > <
        /MDBCard> < /
        MDBCol >
    )
}

export default CardExample;
